import { FC, useState } from "react";
import UsersList from "./UsersList";
import { UserData } from "../../UserData";
import Header from "../Header";
import Menu from "../Menu";

type UserProps = {};

const User: FC<UserProps> = () => {
  const [users, setUser] = useState<UserData[]>([
    {
      id: 1,
      email: "lbui21199@gmail.com",
      password: "123456",
      name: "Long",
      sex: "male",
      birthday: new Date(1999 - 1 - 2),
      address: "VietNam",
      phone: "099999999",
    },
    {
      id: 2,
      email: "lbui21199@gmail.com",
      password: "123456",
      name: "Long",
      sex: "male",
      birthday: new Date(1999 - 1 - 2),
      address: "VietNam",
      phone: "099999999",
    },
  ]);
  // console.log(users, "users");
  return (
    <div>
      <Header />
      <div className="flex">
        <div className="w-[15%]">
          <Menu />
        </div>
        <div className="w-[85%]">
          <UsersList users={users} />
        </div>
      </div>
    </div>
  );
};

export default User;
